import './App.css';
import { BrowserRouter as Router, Routes, Route, NavLink} from 'react-router-dom';
import Home from './views/Home';

function App() {
  return (
    <div className="App"> 
      <Router>
        <div className="nav">
          <NavLink
            to="/"
            style={({ isActive }) => ({
              color: isActive ? 'aqua' : '#545e6f',
              textDecoration: 'none'
            })}
          >
            Home
          </NavLink>
          <NavLink
            to="/recipes"
            style={({ isActive }) => ({
              color: isActive ? 'aqua' : '#545e6f',
              textDecoration: 'none'
            })}
          >
            RecipesAPI
          </NavLink>


        </div>
        <Routes>
            <Route path='/' element={<Home/>} />


          </Routes>
        </Router>
    </div>
  );
}

export default App;
